import React, {useState} from 'react';

import Card from '@material-ui/core/Card';
import CardHeader from '@material-ui/core/CardHeader';
import Typography from '@material-ui/core/Typography';
import CardContent from '@material-ui/core/CardContent';
import Grid from '@material-ui/core/Grid';
import EditIcon from '@material-ui/icons/Edit';
import IconButton from '@material-ui/core/IconButton';
import PrintIcon from '@material-ui/icons/Print';

import { Link } from 'react-router-dom';
import { CardActions } from '@material-ui/core';

import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';

function TilauksetMappaus (props) {
const tilaukset=props.tilaukset;

const [open, setOpen] = useState(false)

const handleClickOpen = () => {
    setOpen(true);
};

const handleClose = () => {
    setOpen(false);
};

const [asiakas, setAsiakas] = useState([]);

const url= 'http://localhost:8080'

const haeAsiakas = async(e) => {
    const str = (e.tilaus.asiakas);

    const nimi = str.split(' ');
    let etunimi= nimi[0];
    let sukunimi= nimi[1];
    console.log(etunimi, sukunimi);

    try {
        const response = await fetch (url + '/kanta/asiakkaat/one/' + etunimi + '/' + sukunimi);
        const json = await response.json();
        setAsiakas(json);
        console.log('Asiakkaan haku onnistui')
    }catch (error) {
        setAsiakas([]);
        console.log('Asiakkaan haku ei onnistunut');
    }
}


console.log(tilaukset);
return (
    <Grid container spacing = {4}>
            {tilaukset.map(tilaus => {
                return (
                    <Grid item key={tilaus.id}>
                        <Card style={{minWidth: 250, minHeight: 400}}>
                            <CardHeader
                            title={tilaus.tuote}
                            subheader= {tilaus.asiakas}/>
                            <CardContent>
                            <Typography>Tilauspäivämäärä: {tilaus.tilauspvm}</Typography>
                            {tilaus.toimpvm ? 
                                <Typography>Toimituspäivämäärä: {tilaus.toimpvm}</Typography>
                                : <Typography>Ei vielä toimitettu</Typography>
                            }
                            <Typography>Hinta: {tilaus.hinta}€</Typography>
                            <Typography>Työntekijä: {tilaus.tyontekija}</Typography>
                            
                            {tilaus.toimpvm ? 
                                <Typography>Et voi enää muokata tilausta</Typography>
                                : <CardActions>
                                    <IconButton component={ Link } to={ '/muokkaatilausta/' + tilaus.id + '/' + tilaus.tuote + '/' + tilaus.tilauspvm + '/' + tilaus.tyontekija + '/' + tilaus.toimpvm + '/' + tilaus.hinta + '/' + tilaus.asiakas}><EditIcon /></IconButton>
                            
                                  </CardActions>
                            }
                            <CardActions>
                                
                            <IconButton onClick={handleClickOpen, haeAsiakas}><PrintIcon /></IconButton>
                                <Dialog open={open} onClose={handleClose}>
                                <DialogTitle>Lasku</DialogTitle>
                                <DialogContent>
                                    <Typography>{asiakas.etunimi} {asiakas.sukunimi}</Typography>
                                    <Typography>{asiakas.osoite}</Typography>
                                    <Typography>{asiakas.postinumero} {asiakas.postitoimipaikka}</Typography>
                                    <Typography gutterBottom> Tuote: {tilaus.tuote} Hinta: {tilaus.hinta}</Typography>
                                    <Typography>Tekijä: {tilaus.tyontekija} </Typography>
                                    <Typography>Toimituspäivämäärä: {tilaus.toimpvm}</Typography>
                                    <Typography>Maksuaika: 14pvää </Typography>
                                    <Typography>Tilinumero: FI04 1234 1234 1234</Typography>

                                </DialogContent>
                                </Dialog>
                            </CardActions>
                            </CardContent>
                        </Card>
                    </Grid>
                )})}
        </Grid>
    );

};
export default TilauksetMappaus;
